tables.table_schema:
CREATE TABLE performance_metrics (
    metric_id UUID PRIMARY KEY,
    page_id UUID,
    load_time FLOAT,
    bounce_rate FLOAT
);

CREATE TABLE pages (
    page_id UUID PRIMARY KEY,
    page_url TEXT UNIQUE
);

CREATE TABLE website_load_times (
    id INT PRIMARY KEY,
    page_url VARCHAR(255),
    load_time_seconds DECIMAL(10,2),
    timestamp TIMESTAMP
);

CREATE TABLE bounce_rates (
    id INT PRIMARY KEY,
    page_url VARCHAR(255),
    bounce_rate DECIMAL(5,2),
    timestamp TIMESTAMP
);

CREATE TABLE WebsiteUsers (
    id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100),
    join_date DATE
);

CREATE TABLE BounceRates (
    bounce_id INT PRIMARY KEY,
    visit_id INT,
    bounce_rate FLOAT,
    timestamp TIMESTAMP
);

CREATE TABLE Website { 
  website_id INT PRIMARY KEY, 
  url VARCHAR(255) NOT NULL, 
  load_time DECIMAL(10,2), 
  bounce_rate DECIMAL(5,2) 
}
